  const driver1 = new Driver({ loc: { x: 50, y: 60 } });

  return (
    <div>
      <h1>Some Title</h1>
      <div>{driver1}</div>
      {/* <div>{driver1.</div> */}
      {/* Button to simulate picking up a passenger */}
      {state === "SEARCHING" && (
        <button
          onClick={() => driver1.search({ location: 10, destination: 20 })}
        >
          Pick up passenger
        </button>
      )}
    </div>
  );
}

export default Screen;
